import React, { Component, Fragment } from "react";
import { Container, Row, Col } from "react-bootstrap";

export default class Services extends Component {
  render() {
    return (
      <Fragment>
        <Container>
          <Row>
            <Col>
              <h1>1</h1>
            </Col>
            <Col>
              <h1>2</h1>
            </Col>
            <Col>
              <h1>3</h1>
            </Col>
          </Row>
        </Container>
      </Fragment>
    );
  }
}
